INSERT INTO `adminnotification_inbox` VALUES (1,2,'2017-06-13 11:20:53','New Patch for PayPal Instant Payment Notification (IPN) Changes. Upgrade to 1.9.3.3 or SUPEE-8167 by June 30, 2017 to Avoid Service Disruptions – 6/13/2017','As of June 30, 2017, PayPal Instant Payment Notifications will no longer allow you to use HTTP to post messages back to PayPal for verification. To comply with these changes, all merchants using PayPal must upgrade to Community Edition 1.9.3.3 or apply the SUPEE-8167 patch. Updates must be in place by June 30, 2017 to avoid any service disruptions. The patch is available on the Community Edition Download Page (https://magento.com/tech-resources/download) and more information is available from PayPal at https://www.paypal-knowledge.com/infocenter/index?page=content&widgetview=true&id=FAQ1916&viewlocale=en_US\n\n','https://magento.com/tech-resources/download ',0,0),(2,1,'2017-07-12 11:15:32','Community Edition 1.9.3.4 and SUPEE-9767 Version 2 Address Issues with May 31 Security Release','Community Edition 1.9.3.4 and SUPEE-9767 v2 (patch) are now available. The new release and updated patch address customer registration and other issues encountered by some merchants when using the original release. Please upgrade as soon as possible to keep your site secure. More information is available in the release notes at  http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html','http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html',0,0),(3,4,'2017-09-08 11:07:06','Survey: Have physical retail stores? If yes, we\'d like your feedback.','If you sell online and through physical storefronts, we\'d like to hear from you.\n\nPlease take our online survey on in-store/ in-branch POS and digital tools.  This survey should take no more than a few minutes to complete.\n\nTo get started, go to: \nhttps://www.surveymonkey.com/r/ZSN9KWC\n\nThank you in advance for your participation.','https://www.surveymonkey.com/r/ZSN9KWC',0,0),(4,2,'2017-09-11 15:52:53','USPS Name Change Impacts “First-Class Mail Parcel” Service – 09/11/2017','USPS changed their “First-Class Mail Parcel” Service to “First-Class Package Service – Retail.” Merchants offering this service must change the name, as “First-Class Mail Parcel” will no longer work. Patches addressing this issue are available on the Magento Open Source download page. More information about the issue is available in a Technical Bulletin at http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ','http://devdocs.magento.com/guides/v2.1/release-notes/tech_bull_USPS-patch-Sept2017.html ',0,0),(5,1,'2017-09-15 10:50:16','Magento Open Source 1.9.3.6 and SUPEE-10266 Security Enhancements – 9/14/2017','Magento Open Source 1.9.3.6 and SUPEE-10266 include critical security enhancements. Please update your site as soon as possible. More information is available in the release notes: \nhttp://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html.\n','http://devdocs.magento.com/guides/m1x/ce19-ee114/ce1.9_release-notes.html',0,0),(6,4,'2017-09-26 15:42:02','Magento Open Source 2.2 Delivers Enhanced Commerce Capabilities – 9/26/2017','Magento Open Source 2.2 includes a range of platform enhancements, including a new deployment process that minimizes production downtime, optimized performance, platform updates that improve developer experience, and Magento Social marketing tools. Learn more at http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html.\n\n','http://devdocs.magento.com/guides/v2.2/release-notes/bk-release-notes.html ',0,0),(7,4,'2017-10-17 06:09:36','Join us for an exclusive B2B merchant event in Chicago!','Transform your business at the Magento B2B Experience on November 2 in Chicago. \n\nNetwork with industry leaders, B2B merchants, and partners to gain insights on B2B best practices, and to discover how to create powerful buyer experiences using Magento to boost your growth. RSVP today! \n\nRegister for free at https://b2bexperience.magento.com\n\nNote: This is a merchant-only event.\n','https://b2bexperience.magento.com',0,0),(8,4,'2017-10-27 09:54:48','Last Chance: join us on Nov 2 at the Magento B2B merchant event in Chicago!','Transform your business at the Magento B2B Experience on November 2 in Chicago. \n\nNetwork with industry leaders, B2B merchants, and partners to gain insights on B2B best practices, and to discover how to create powerful buyer experiences using Magento to boost your growth. RSVP today! \n\nRegister for free at https://b2bexperience.magento.com\n\nNote: This is a merchant-only event.\n','https://b2bexperience.magento.com',0,0),(9,4,'2011-08-21 23:45:25','Magento Absolute theme is available for Magento Go now! ','Magento Absolute theme is available for Magento Go now! ','http://templates-master.com/magento-templates/free-absolute-magento-go-template.html',0,0),(10,4,'2011-09-05 23:27:48','New Elastic Premium template for Magento is published','New Elastic Premium template for Magento is published.','http://bit.ly/pf0ilp ',0,0),(11,3,'2011-09-11 18:37:58','Magento 1.6 compatability update','All our themes and extensions compatible with Magento 1.6 CE now!  Request your update at http://bit.ly/q51qxj ','http://bit.ly/q51qxj ',0,0),(12,4,'2011-09-18 22:52:59','Check our new Affiliate Suite extension for Magento CE','Affiliate Suite by Templates Master will help you to build new efficient sales channe. Your new affiliate partners will be able to promote your store by emailing, placing links, banners and other  media on their sites and any social networks profiles.','http://bit.ly/oKa0zd ',0,0),(13,4,'2011-10-12 00:02:30','Magento Easybanners 1.1 is now available','Easybanners provide easy and powerful tools to manage and target banners to specific users. We are proud to announce that this extension provide support for Magento widgets now. So you can place any banner or placeholder right into your cms page. We have also added option to call out placeholders directly in the phtml templates.','http://bit.ly/phgpx5',0,0),(14,4,'2011-11-04 02:49:59','Join us on Facebook and get one time 10% OFF on all our templates and extensions.','Join us on Facebook and get one time 10% OFF on all our templates and extensions.','http://on.fb.me/rYE7qW ',0,0),(15,4,'2011-11-08 01:00:10','Affiliate Suite 1.0.5  is now available','Affiliate Suite by Templates Master will help you to build new efficient sales channel and start offering affiliate programs at your store.\n\nNew features\n- Allow to copy banners\n- Autoselect default campaign on partner registration\n- Ordered products report interface added\n\nBug fixes\n- Prowidget tool hidden on frontend if disableded','http://bit.ly/saXDyk',0,0),(16,4,'2011-11-11 00:40:50','Firecheckout 1.6.1 compatability update ','Firecheckout is now fully compatible with Magento 1.6.1','http://bit.ly/sUDhHK ',0,0),(17,4,'2011-11-17 01:28:50','New Product Highlight extension for Magento is now available!','New Product Highlight extension for Magento is now available!','http://bit.ly/tGwtwZ ',0,0),(18,4,'2011-11-22 02:04:45','Magento Easy Slider is now available as standalone extension!','Magento Easy Slider is now available as standalone extension!','http://bit.ly/uu0GxJ ',0,0),(19,4,'2011-11-28 00:45:49','Cyber Monday Discount! Get 20% off for all our products - code THNK20 ','Cyber Monday Discount! Get 20% off for all our products - code THNK20 ','http://bit.ly/sBBbSa',0,0),(20,4,'2011-11-30 00:22:50','Helpmate 1.1 is now available','Helpmate 1.1 is now available\n\nFeatures:\n- 2 types of contact form. First is default and second one is like http://www.payoneer.com/contactUs.aspx \n- Attach allowed files from emails\n- Akismet integration\n\nBug fix\n- File upload bug in admin fixed','http://bit.ly/teCtnm ',0,0),(21,4,'2011-12-12 22:44:45','Magento 1.6.1 compatability update','We are glad to inform that recent themes 1.6.1 update also include recent version of Highlight and Easyslide extension.\nRequest your update at http://bit.ly/q51qxj ','http://bit.ly/sEHONg ',0,0),(22,4,'2011-12-21 01:14:11','Social Suit extension for Magento is now available!','Social Suit - New Facebook & Google social networks integration extension for Magento','http://bit.ly/ugYisg ',0,0),(23,4,'2012-01-11 22:50:11','Firecheckout 2.0 is now available.','Firecheckout 2.0  is now available with great new features:\n\n- Configurable address form fields sort order\n- Delivery date option\n- Flexible AJAX updates for checkout page\n- Improved overall performance over 30%\n- Now  available in 11 languages (English, Arabic, Chinese Simplified, Dutch, French, German, Italian, Japanese, Korean, Portuguese, Russian, Spanish, Swedish)','bit.ly/sUDhHK',0,0),(24,4,'2012-01-19 01:39:44','Magento Affiliate Suite 1.1 and Ajax Pro 1.6.6 are now available.','Magento Affiliate Suite 1.1 and Ajax Pro 1.6.6 are now available.','http://bit.ly/ycr6uq ',0,0),(25,4,'2012-01-30 00:10:21','Magento Affiliate Suite 1.1.1 is now available','Please update your Affialite suite to recent 1.1.1 version.','bit.ly/saXDyk',0,0),(26,4,'2012-02-02 00:26:01','Social Suite 1.1 with great new features is now available','- Twitter integration\n- Allow to login with social networks on checkout page\n- Firecheckout login integration support\n- Floating social panel\n- Improved localization\n','http://bit.ly/A8h4yk',0,0),(27,4,'2012-02-14 23:44:58','Lightbox Pro extension for Magento is now available!','Lightbox Pro will replace default magento image zoom with new easy-to-use and flexible Lightbox widget. ','http://bit.ly/xmm1WU',0,0),(28,4,'2012-03-12 02:11:39','Mobile Star - Android and iPhone theme for Magento is now available!','Don’t loose your chance to keep contact with your customers while they are using their phones. We have created Mobile Star Magento theme that will help you join new e-commerce revolution and build your mobile presence just in 5 minutes. Mobile Star is specially des