INSERT INTO `catalog_product_entity_text` VALUES (36,4,72,0,5,'<p>T&aacute;c giả: Tiểu Quỳ</p>'),(37,4,73,0,5,'<p>T&aacute;c giả: Tiểu Quỳ</p>'),(38,4,83,0,5,NULL),(39,4,106,0,5,NULL),(42,4,72,0,6,'<p>Bằng kinh nghiệm của một người đã trải qua nhiều năm kinh doanh, tác giả nói về những khó khăn m  những người khởi nghiệp thường gặp phải. Qua từng chương sách, tác giả dẫn dắt từ những ng y đầu như lên ý tưởng kinh doanh, tìm các đồng sáng lập, tìm kiếm khách h ng đến khi việc kinh doanh gặp những vấn đề không của riêng ai: Bất đồng giữa các sáng lập viên, công ty không được thị trường đón nhận, kinh doanh đã lâu m  chưa tìm được điểm hòa vốn, thiếu kinh phí,... Những chương cuối tác giả tập trung nhìn v o các vấn đề con người như mất niềm tin, không còn năng lượng để tiếp tục, ho i nghi v o chiến lược mình đã lựa chọn,\r\n\r\nỞ Vấp, nhưng đừng ngã tác giả tập trung v o khía cạnh con người trong bối cảnh khởi sự kinh doanh. Tác giả tiếp cận trực tiếp v o vấn đề, nói lên những khó khăn, đôi khi có phần không lối thoát bằng một giọng văn h i hước, khiến những khó khăn ấy chỉ như những cú sa chân vấp.  Những cú vấp ấy không đáng sợ, bởi khi đã chấp nhận khởi nghiệp thì mỗi người đều phải chấp nhận thử sai v  sai rất nhiều lần trước khi đạt được th nh tựu.\r\n\r\nTác giả tự nhận mình nghĩ sao viết vậy nên có thể đôi chỗ độc giả thấy sao người n y xuề xòa vậy, nhưng đấy l  dụng ý riêng, bởi anh muốn nhìn thật  nói thật. Bởi anh không có tham vọng đưa ra một cẩm nang khởi nghiệp m  muốn mỗi người, sắp, đang hay đã khởi sự kinh doanh sẽ tìm thấy một phần của mình trong đó.</p>'),(43,4,73,0,6,'<p>Cuốn sách Vấp, Nhưng Đừng Ngã của tác giả Vũ Thái H  sẽ đem đến những b i học về cuộc sống cũng như tiếp thêm nguồn động lực giúp ta vượt qua những thử thách trong cuộc sống..</p>'),(44,4,83,0,6,NULL),(45,4,106,0,6,NULL),(58,4,72,0,7,'<p>Nghệ Thuật Bán Mình Cho Sếp\r\n\r\nNếu đang đi tìm việc, bạn phải thuyết phục được người chủ rằng họ sẽ thu được lợi ích từ bạn, rằng bạn sẽ là nhân tố không thể thiếu trong doanh nghiệp của họ, rằng bạn có các tố chất đáng ghi điểm. Nói cách khác, họ phải thấy chính bản thân bạn đã là một thành công của họ.\r\n\r\nĐược viết bởi tác giả truyền cảm hứng số 1 thế giới Orison Swett Marden, cuốn sách Nghệ thuật bán mình cho sếp mang đến cái nhìn về những gì mà người chủ tìm kiếm trong một nhân viên, đồng thời đưa ra những phương thức để giúp bạn hoàn thành công việc một cách tốt nhất, trở nên nổi bật, được người chủ để mắt và thành công trong sự nghiệp.\r\n\r\nHãy biến mỗi việc bạn làm thành một kiệt tác!</p>'),(59,4,73,0,7,'<p>Tác giả: Orison Swett Marden</p>'),(60,4,83,0,7,NULL),(61,4,106,0,7,NULL),(62,4,72,0,8,'<p>Tôi Biết Ơn & Tôi Giàu Có\r\n\r\nTôi biết ơn & tôi giàu có là cuốn sách dành cho bất cứ ai quan tâm đến việc tìm kiếm, bắt sóng và kết nối với nguồn năng lượng huyền vi và vô tận của Vũ trụ. Cuốn sách này còn cho độc giả biết thêm nhiều khía cạnh mới mẻ về sự sung túc và viên mãn cũng như cách thức để phát triển nguồn vốn sáng tạo, vốn xã hội, vốn tinh thần và rất, rất nhiều tài sản tinh thần quý giá khác trong đời bạn.\r\n\r\n \r\n Chúng ta ở đây vào thời điểm đặc biệt này trên Trái Đất là để mở mang vũ trụ chứ không phải để chiến thắng một giải thưởng hàn lâm nào cả. Chúng ta không phải dùng tài năng của mình để vượt lên và đánh bại bất kỳ ai, cũng không phải để chịu đựng những đau khổ hay giằng xé niềm tin vinh quang rồi sẽ đến sau cơn bĩ cực.\r\n \r\n Cuộc sống hàng ngày chính là ngôi đền thiêng liêng để bạn đạt được sự thanh tĩnh, sự hài lòng và rung động thần thánh, cũng như \"lấy ra\" niềm hạnh phúc đích thực.\r\n \r\n Một trong những cách tốt nhất mà chúng ta có thể phụng sự người lữ hành trong chính mình, là hình dung ra cách làm cho bản thân biết mãn nguyện và sung sướng. Bạn hãy giúp người khác biết rằng có thể tự làm cho bản thân vui sướng mới là điều tốt đẹp nhất.</p>'),(63,4,73,0,8,'<p>T&aacute;c giả: Pam Grout</p>'),(64,4,83,0,8,NULL),(65,4,106,0,8,NULL),(98,4,72,0,9,'Làm Chủ Giao Tiếp Để Thành Công\r\n\r\nGiao tiếp là việc hằng ngày ai cũng phải làm, nhưng lại rất ít người trong chúng ta chịu đặt ra câu hỏi: Giao tiếp như thế nào cho hiệu quả?. Vì không chịu nâng cao kỹ năng đối thoại, chúng ta rất dễ thụ động trong các tình huống xã hội. VD: Khi bạn kể chuyện, người nghe dù rất chăm chú vẫn không hiểu bạn muốn nói gì. Nếu phải đứng trước đám đông phát biểu, bạn sẽ lúng túng như gà mắc tóc. Bạn rất tự tin khi gặp gỡ nhà tuyển dụng, nhưng cuối cùng lại không gây được ấn tượng nào với họ           \r\n\r\nViệc đặt ra những câu hỏi như Phải dùng giọng điệu thế nào cho hay?, Không nên nói điều gì để tránh gây nhàm chán chỉ mất thêm của bạn khoảng vài phút trước cuộc hội thoại nhưng lại tạo ra hiệu quả hoàn toàn khác biệt. Nếu muốn tiến bộ, hãy học hỏi và luyện tập từ những điều nhỏ nhất.\r\n\r\nCuốn sách Làm chủ giao tiếp để thành công của Satoshi Noguchi sẽ giúp bạn tìm ra các vấn đề để cải thiện kỹ năng giao tiếp và cung cấp các kỹ thuật nhằm giải quyết các vấn đề đó. Bên cạnh các lời khuyên, tác giả cũng liên tục đưa ra những ví dụ cụ thể, thực tế trong cuộc sống để độc giả dễ dàng tham khảo và áp dụng. Hãy nhớ rằng, mọi rào cản khó khăn trong khi trò chuyện đều có thể được phá vỡ. Ngưng trì hoãn, bắt đầu thay đổi và thực hành ngay hôm nay, bạn sẽ trở nên tự tin hơn rất nhiều trong lần tiếp theo phải xử lý các tình huống tương tác ngoài xã hội.'),(99,4,73,0,9,'<p>T&aacute;c giả: Satoshi Noguchi </p><p>Người dịch: Hoàng Linh</p>'),(100,4,83,0,9,NULL),(101,4,106,0,9,NULL),(102,4,72,0,10,'abc'),(103,4,73,0,10,'abc'),(104,4,83,0,10,NULL),(105,4,106,0,10,NULL),(106,4,72,0,11,'abc'),(107,4,73,0,11,'abc'),(108,4,83,0,11,NULL),(109,4,101,0,11,NULL),(110,4,106,0,11,NULL),(118,4,72,0,12,'edf'),(119,4,73,0,12,'edf'),(120,4,83,0,12,NULL),(121,4,106,0,12,NULL),(137,4,72,0,13,'a'),(138,4,73,0,13,'tac gia: Carron Brown, Bee Johnson'),(139,4,83,0,13,NULL),(140,4,106,0,13,NULL),(141,4,72,0,14,'\r\nBật Đèn Soi Bí Mật - Ngoài Công Trường\r\n\r\nNhững trang sách có thể nhìn xuyên thấu trong cuốn sách tranh được minh họa tuyệt đẹp về các sự vật thực tế đem lại những trải nghiệm tương tự giống như các cuốn sách lật giở trước đó, nhưng \"Bật đèn soi bí mật\" mở rộng sự tương tác với các bé, giúp các em có thể nhìn thấy những thứ nổi bật trên bề mặt và được ẩn giấu cùng lúc trong mỗi bức tranh.\r\n\r\nLà một món quà về cả mặt hình ảnh lẫn niềm vui dành cho trẻ em, \"Bật đèn soi bí mật\" là một sự lựa chọn lí tưởng cho các phụ huynh cùng đọc sách và chơi đùa với con.\r\n\r\nTrong cuốn “Bật đèn soi bí mật: Ngoài Công Trường”: Chúng ta có thể thấy gì trên các công trường xây dựng ngày nay?\r\n\r\nHãy soi đèn vào phía sau trang sách và cùng xem nhé...\r\n\r\nTừ người lái cẩu ngồi trên buồng lái và những kĩ sư đang đào bới sâu trong lòng đất tới những chiếc máy ủi và tất cả những loại máy móc khác... mỗi lần lật sang trang sách mới, em sẽ thấy những hình ảnh khác nhau của một công trường xây dựng bận rộn.\r\n'),(142,4,73,0,14,'tac gia: Carron Brown, Bee Johnson'),(143,4,83,0,14,NULL),(144,4,106,0,14,NULL),(145,4,72,0,15,'\r\n\r\nBật Đèn Soi Bí Mật - Bí Mật Của Cây Táo\r\n\r\nNhững trang sách có thể nhìn xuyên thấu trong cuốn sách tranh được minh họa tuyệt đẹp về các sự vật thực tế đem lại những trải nghiệm tương tự giống như các cuốn sách lật giở trước đó, nhưng \"Bật đèn soi bí mật\" mở rộng sự tương tác với các bé, giúp các em có thể nhìn thấy những thứ nổi bật trên bề mặt và được ẩn giấu cùng lúc trong mỗi bức tranh.\r\n\r\nLà một món quà về cả mặt hình ảnh lẫn niềm vui dành cho trẻ em, \"Bật đèn soi bí mật\" là một sự lựa chọn lí tưởng cho các phụ huynh cùng đọc sách và chơi đùa với con.\r\n\r\nTrong cuốn “Bật đèn soi bí mật: Bí Mật Của Cây Táo”: Những sinh vật nào sống xung quanh một cây táo?\r\n\r\nHãy soi đèn vào phía sau trang sách và cùng xem nhé… Hãy quan sát kĩ một cái cây, em sẽ phát hiện ra một thế giới nhỏ đầy những bất ngờ!\r\n\r\nTừ những con giun đất bò quanh rễ cây đến những chú chim làm tổ trên cành cao, nhiều điều thú vị tiềm ẩn trong thế giới đông đúc này sẽ dần hé mở.\r\n'),(146,4,73,0,15,'tac gia: Carron Brown, Bee Johnson'),(147,4,83,0,15,NULL),(148,4,106,0,15,NULL),(194,4,72,0,20,'Here We Go - Cứ Mơ Và Cứ Đi khởi đầu bằng những miền đất ở Việt Nam. Đó là những nơi có thể bạn đã từng đi mòn dấu chân, cũng có cả những vùng đất mới bạn còn háo hức tìm hiểu. Những chuyến chu du lên rừng xuống biển đưa bạn đi hết từ ngạc nhiên này đến bất ngờ khác, biên độ dao động từ đẹp đến đẹp… phi thường. Những rung cảm từ trái tim trước một góc xinh xắn ở Hội An mà bạn chưa mày mò ra kịp, cho đến cảm giác nghẹt thở rồi đưa tay lên chạm vào bức ảnh chụp một con đèo đẹp đến lặng người ở miền Tây Bắc. Muôn vàn khung cảnh nơi dải đất hình chữ S tuyệt đẹp đã sẵn sàng để chờ bạn khám phá trong phần đầu tiên của cuốn sách này.\r\n\r\nRong ruổi qua một Việt Nam tươi đẹp, cuốn sách sẽ tiếp tục đưa độc giả bước ra ngoài thế giới. Nơi chúng ta có thể đi xuyên qua những màn mây lãng đãng nhuốm mùi ban sớm ở một đất nước Đông Nam Á huyền bí, hay cùng lần giờ trang sách để ngắm nghía những mùa hoa và miền quê nước Nhật, tiếp tục hít hà mùi sách và tưởng tượng ra ta đang đứng giữa một buổi hoàng hôn lộng lẫy nên trời Âu và cuối cùng, cảm nhận cái thế giới sống động, ồn ã của New York Hoa Lệ.\r\n\r\nTất cả những trải nghiệm trong cuốn sách này đều là những hành trình đích thực đã được các thí sinh của cuộc thi HERE WE GO - mùa thứ nhất ghi lại và được Kenh14.vn tuyển tập thành Here We Go - Cứ Mơ Và Cứ Đi - một cuốn sách của cảm hứng và tuổi trẻ. Thế giới rộng lớn ngoài kia và mỗi chúng ta lại nhỏ bé biết bao, còn quá nhiều cảnh đẹp và sự vĩ đại đang chờ chúng ta tìm đến và tận hưởng. “Hãy cứ mơ và cứ đi!” vì cả thế giới bao la ngoài kia đang chờ đợi bạn và tuổi trẻ thì chỉ có một lần duy nhất!\r\n\r\nVới hơn 30 bài viết trong Here We Go - Cứ Mơ Và Cứ Đi, chắc chắn rằng khi bạn đọc mở cuốn sách ra, nó sẽ đủ hấp dẫn và tuyệt vời để cho đến khi gấp sách lại, bạn sẽ sẽ muốn buông hết những âu lo muộn phiền, và mạnh dạn xách ba lô lên.'),(195,4,73,0,20,'a'),(196,4,83,0,20,NULL),(197,4,106,0,20,NULL),(198,4,72,0,21,'c'),(199,4,73,0,21,'a'),(200,4,83,0,21,NULL),(201,4,106,0,21,NULL),(202,4,72,0,22,' Tập bút ký Tôi là một con lừa của Nguyễn Phương Mai lại là câu chuyện của một người phụ nữ hiện đại ưa xê dịch, với mong muốn lấp đầy mình bằng những điều mới mẻ của thế giới, đồng thời khám phá chính bản thân mình.\r\n\r\nPhương Mai viết văn từ lúc học lớp 10 và là cây bút đóng góp cho báo Hoa Học Trò những số đầu tiên. Năm 17 tuổi, Phương Mai ra tập truyện ngắn đầu tay có tên Đối diện. Hai năm sau khi tốt nghiệp Cao đẳng Sư phạm Hà Nội, Phương Mai trở thành thư ký tòa soạn báo Hoa Học Trò ở tuổi 24.\r\n\r\nNhưng chị sớm từ bỏ vị trí hấp dẫn đó để đi du học Hà Lan, giành học vị Thạc sĩ khoa học ngành Thiết kế giáo dục và Tiến sĩ ngành Giao tiếp đa văn hóa. Từ đó đến nay, Phương Mai là giảng viên tại khoa Kinh tế, Đại học Amsterdam, Hà Lan. Muốn làm \"một hòn đá lăn không bám rêu\", Phương Mai đã đặt chân đến gần 80 quốc gia trên thế giới.\r\n\r\nNguyễn Phương Mai đã tuyên ngôn như vậy trong Tôi là một con lừa - cuốn sách đầu tiên trong xê ri Lên đường với trái tim trần trụi của chị. Tại sao lại là một con lừa? Bởi vì \"Thân lừa ưa nặng\". Con lừa Nguyễn Phương Mai đã khước từ cuộc sống êm ái theo quan niệm của chúng ta - có nhà lầu, xe hơi, có chồng con và một công việc ổn định - để miệt mài lao mình vào những chuyến đi. Phương Mai đã đặt chân đến gần 80 quốc gia trên thế giới, đã chiêm ngưỡng những cảnh tượng thiên nhiên tráng lệ nhất, đã thăm viếng những kỳ quan vĩ đại nhất do bàn tay con người làm nên, đã thử sức với những trò mạo hiểm mà chỉ nghĩ đến thôi cũng khiến nổi da gà. \"Thành tích\" đi phượt, đi bụi của Phương Mai có thể làm ghen tị bất cứ một \"phượt thủ\" dày dạn nào.\r\n\r\nNhưng nếu chỉ có vậy thì Phương Mai khác gì với những người trẻ thích xê dịch hiện nay, mà trong đó có nhiều người đi phượt theo mốt, đi để thể hiện, đi để lấy thành tích, đi để lấy địa điểm? Việc \"ta đã từng đến nơi đây\" có thể có một ý nghĩa nhất định. Nhưng điều quan trọng hơn là ta đã nghĩ gì, cảm gì, ngộ ra điều gì, tâm hồn ta đã thay đổi như thế nào, và từ đó hành động của ta chuyển biến ra sao. Phương Mai lên đường để hiểu ra rằng những định kiến đã khiến chúng ta sai lệch, thậm chí ngu ngốc, để thấy sự lố bịch của con người trước tự nhiên vĩ đại, để thấy sự nguy hiểm của tâm lý đám đông, hay để nhận ra vẻ đẹp cuộc sống ở khắp mọi nơi.\r\n\r\nCô dịch chuyển cũng để chiêm nghiệm về danh tính bản thân - về mẫu hình mà mình muốn trở thành và mẫu hình xã hội muốn mình trở thành; để dò xét sức mạnh của mình và phát hiện ra chế ngự được nỗi sợ hãi của bản thân mới chính là điều khó khăn nhất. Tất cả những trải nghiệm ấy đã khiến Phương Mai thay đổi cách hành xử trong cuộc sống theo hướng tích cực hơn, trong đó có việc đem những câu chuyện còn lấm lem bụi đường nhưng đầy sức thuyết phục tới các sinh viên từ khắp năm châu theo học bộ môn Giao tiếp đa văn hóa mà cô giảng dạy tại Đại học Amsterdam, Hà Lan.\r\n\r\nTrong xã hội Việt Nam, dường như những mệnh đề phụ nữ và tự do, độc thân và hạnh phúc được coi là trái ngược nhau, khó có thể sóng đôi. Bằng cách sống của mình, Phương Mai đã chứng minh điều ngược lại. Phương Mai là một trong những điển hình của người phụ nữ hiện đại: độc thân, thành đạt, tự do, tự tin và hạnh phúc. (less)'),(203,4,73,0,22,' by Nguyễn Phương Mai '),(204,4,83,0,22,NULL),(205,4,106,0,22,NULL),(206,4,72,0,23,'\r\nĐiều đáng sợ nhất của tuổi trẻ không phải là thất tình, thất nghiệp mà đáng sợ nhất là uể oải trong một vòng luẩn quẩn buồn tẻ và rồi ngày ngày thất vọng về bản thân.\r\n\r\nBởi thế đôi lúc trong đời bạn thức dậy, nhìn qua ô cửa sổ rồi đột nhiên muốn biến thành một cánh chim tự do bay đến những chân trời mới\r\n\r\nƯớc rằng bạn đang ở 1 nơi xa với những điều chưa bao giờ chạm tới.\r\n\r\nNhững ngày như vậy, nếu không thể xách ba lô lên và đi đâu đó, thì hãy ngồi xuống cùng một tách trà và đọc cuốn du kí tràn đầy năng lượng Những Ngày Ở Châu Âu\r\n\r\nCuốn sách vừa là một cuốn du kí vừa là ngập tràn cảm hứng sống. Vừa thôi thúc bạn phấn đầu để một ngày: Châu Âu – Những điều đẹp đẽ kia đều nằm trong tay bạn.\r\n\r\nCả Châu Âu rộng lớn sẽ thu bé lại vừa bằng một cuốn sách. Tuy bé mà sức hấp dẫn vô biên\r\n\r\nCho đến cuối cùng thì việc nỗ lực kiếm tiền âu cũng chỉ là để bản thân có thể hưởng thụ cuộc sống một cách tốt nhất. Vậy thì tại sao bạn không thử khiến mình thấy thoải mái hơn nhờ những điều khác biệt trong cuộc sống này?\r\n\r\nCó phải vì bạn chưa đủ tự tin, chưa đủ dũng cảm để tự bước ra ngoài kia khám phá những chân trời mới?\r\n\r\nVậy thì Những Ngày Ở Châu Âu sẽ giúp bạn thêm sức mạnh để vươn tay chạm vào những điều mới mẻ và thú vị. Bởi trong cuốn sách này là hàng ngàn điều kỳ thú mà bất cứ ai đọc được cũng sẽ khao khát một lần trong đời này được tận mắt chứng kiến, tận tâm trải nghiệm.\r\n\r\nSuy cho cùng, người hạnh phúc nhất không phải là người sở hữu nhiều vật chất, tiền bạc. Người hạnh phúc nhất là người tuy chẳng có nhiều thứ trong tay nhưng lại có trong ký ức và cuộc đời mình những phong phú về trải nghiệm.\r\n\r\nHãy đi để biết rằng cuộc đời này còn nhiều lắm những thứ đáng giá hơn giá trị vật chất và đi để cảm thấy rằng nhỏ bé nhưng chưa bao giờ tầm thường !\r\n'),(207,4,73,0,23,'Tác giả: Vũ Minh Đức\r\n\r\nThể loại: Sách du lịch\r\n\r\nSố trang: 256\r\n\r\nKhổ: 14 x 20.5cm\r\n\r\nGiá bìa: 86.000\r\n\r\nĐối tác liên kết: NXB Thế Giới'),(208,4,83,0,23,NULL),(209,4,106,0,23,NULL),(210,4,72,0,24,'Một quốc gia, một dân tộc luôn ẩn chứa rất nhiều mã số thuộc nhiều lĩnh vực trên suốt quá trình lập quốc đến tận hôm nay.\r\nMuốn nghiên cứu, tìm hiểu sau và đầy đủ về quốc gia dân tộc đó, chắc chắn chiếc chìa khoá giải mã đầu tiên hân hạnh được trao cho quý độc giả đang nằm trong nội dung cuốn sách này.\r\nĐây là mộtcông trình biên soạn công phu được tổng hợp tất cả các thông tin trên của hơn 190 nước từ những nguồn tư liệu quý, được cập nhật, có giá trị. Hy vọng nội dung sách sẽ cung cấp cho quý độc giả những thông tin bổ ích trong việc tìm hiểu về các dân tộc anh em trên thế giới....'),(211,4,73,0,24,'Tác giả: Vũ Hải, Nguyễn Thuận Ánh, Nguyễn Kim Dân, Nguyễn Hống Trang\r\nNhà xuất bản: Nxb Văn hóa Thông tin\r\nNhà phát hành: Văn Lang'),(212,4,83,0,24,NULL),(213,4,106,0,24,NULL),(255,4,72,0,28,'\r\nNhân Tố Enzyme\r\n\r\nTừ kết quả lâm sàng khi tiến hành kiểm tra dạ dày của hơn 300.000 người, bác sĩ Hiromi Shinya đã rút ra kết luận: “Người có sức khỏe tốt là người có dạ dày đẹp, ngược lại, người có sức khỏe kém là người có dạ dày không đẹp.”\r\n\r\nTrong cuốn sách này, Hiromi Shinya sẽ giới thiệu với các bạn về phương pháp sống lâu và khỏe mạnh mà ông đã dày công nghiên cứu cùng với sự trợ giúp của đông đảo các bệnh nhân của ông.\r\n\r\nVậy, làm thế nào để có thể sống lâu và khỏe mạnh? Nếu nói ngắn gọn trong một câu thôi thì đó là sống mà không tiêu tốn hết “enzyme diệu kỳ”.\r\n\r\nCó lẽ sẽ có nhiều người thắc mắc về cụm từ “enzyme diệu kỳ”. Nói một cách đơn giản, “enzyme diệu kỳ” là enzyme nguyên mẫu của hơn 5.000 loại enzyme trong cơ thể, đảm nhiệm các hoạt động duy trì sự sống của con người.  Các ezyme cần thiết này hình thành ngay trong tế bào của cơ thể sống và chúng ta còn có thể tự tổng hợp enzyme qua các bữa ăn hàng ngày.\r\n\r\nVậy điều khiến chúng ta tiêu tốn enzyme diệu kỳ, làm thế nào để để bổ sung enzyme diệu kỳ hãy cùng tìm hiểu trong cuốn sách Nhân tố Ezyme này nhé.\r\n'),(256,4,73,0,28,'a'),(257,4,83,0,28,NULL),(258,4,106,0,28,NULL),(259,4,72,0,29,'Cơ thể được xây đắp bởi đồ ăn thức uống hàng ngày, nguồn năng lượng cho chúng ta hoạt động cũng từ đó. Vì vậy, hiểu biết Minh triết trong Ăn uống của phương Đông là điều vô cùng cần thiết. Tác giả Ngô Đức Vượng từ lâu đã quan tâm tới vấn đề này. Ông đã ăn chay trường, ăn gạo lứt muối vừng, nhịn ăn chữa bệnh cho chính mình và giúp cho nhiều người thực hành tự chữa bệnh, dưỡng sinh, nâng cao sức khỏe, thu nhiều kết quả tốt đẹp từ nhiều năm nay. Với thiện chí đem lại sức khỏe và trị bệnh không dùng thuốc, ít tốn kém, dễ thực hành… cho cộng đồng, tác giả đã viết cuốn sách này, nhằm cống hiến cho bạn đọc những lời khuyên quý giá và đáp ứng những nhu cầu cần thiết cho độc giả.\r\n\r\nLà một nhà khoa học chân chính, lương y giàu kinh nghiệm, đã từng tự chữa cho mình mọi bệnh từ cảm cúm đến ung thư, nên tác phẩm của ông đáp ứng được nhiều yêu cầu của bạn đọc. Cung cấp kiến thức tổng quát, tư duy thông thái, giúp người đọc có tầm nhìn và sự đánh giá vấn đề sức khỏe một cách sáng suốt, cùng với những kinh nghiệm thực tiễn giúp cho việc áp dụng vào cuộc sống dễ dàng hơn. Chính vì vậy Minh triết trong Ăn uống của phương Đông của ông là một đóng góp lớn, có giá trị trong lĩnh vực nâng cao sức khỏe và dân trí cho mọi người.\r\n\r\nVới lần tái bản này, cuốn sách có nhiều thay đổi về nội dung cũng như hình thức, nhằm hoàn thiện và đáp ứng phần nào nhu cầu của bạn đọc và chú ý nhấn mạnh vai trò của ăn uống đối với sức khỏe thể chất, tinh thần của mọi người.'),(260,4,73,0,29,'a'),(261,4,83,0,29,NULL),(262,4,106,0,29,NULL),(263,4,72,0,30,'Được coi như cuốn sách lớn nhất của một trong những sử gia lớn nhất thời hiện đại, Những nhà khám phá là một tập khảo luận đồ sộ và bao quát về cách thức nhân loại đã khám phá thế giới, dù còn dang dở (bởi như Einstein đã từng nói, “Cái bí ẩn vĩnh hằng của thế giới là tính khả tri”). Boorstin chứng tỏ mình là một nghệ sĩ bậc thầy khi kết hợp những mảnh tư liệu lớn trong kho tàng lịch sử tri thức thành những cấu trúc trật tự và lô gích, theo một mạch văn sống động, hé mở sự vận động tiệm tiến của tri thức qua truyện kể về những cá nhân kiệt xuất đã từng vạch lối mở đường, bằng niềm tin, sự cẩn trọng cùng ý chí và quyết tâm sắt đá, tiến tới khai phá “miền đất lạ”, làm nên hiểu biết của chúng ta về sự phát triển của vũ trụ trong gần hai thiên niên kỷ qua, truy nguyên từ Ptolemy qua Copernicus và Newton tới Einstein, giúp ta nhìn thấu thời đại Khám phá vĩ đại, Tự nhiên muôn màu và hơn thế nữa... \r\n \r\nLà cuốn mở đầu cho tác phẩm bộ ba lịch sử thế giới bao gồm cả The Creators (Những nhà sáng tạo) và The Seekers (Những người tìm kiếm), nhưng Những nhà khám phá được coi như một kiệt tác độc lập. Một tác phẩm nổi bật, vượt trội, khai mở cho người tò mò muốn biết thế giới đã được khám phá như thế nào, một trong những bách khoa thư lịch sử xuất sắc nhất khó lòng tìm được ở bất cứ nơi đâu khác.\r\n'),(264,4,73,0,30,'a'),(265,4,83,0,30,NULL),(266,4,106,0,30,NULL),(267,4,72,0,31,'Một chuyến du hành đầy trí tuệ qua các vũ trụ, được dẫn dắt tài tình bởi “thuyền trưởng” Michio Kaku và độc giả có dịp chiêm ngưỡng vẻ đẹp kỳ vĩ của vũ trụ kể từ vụ nổ lớn, vượt qua những hố đen, lỗ sâu, bước vào các thế giới lượng tử từ muôn màu kỳ lạ nằm ngay trước mũi chúng ta, vốn dĩ tồn tại song song trên một màng bên ngoài không – thời gian bốn chiều, ngắm nhìn thực tại vật chất quen thuộc hoà quyện với thế giới của những điều kỳ diệu như năng lượng và vật chất tối, sự nảy chồi của các vũ trụ, những chiều không gian bí ẩn và sự biến ảo của các dây rung siêu nhỏ. Vậy, tạm biệt. Hãy nhìn mọi việc một cách đơn giản hơn.. Hãy nhìn mọi việc một cách đơn giản hơn.. Hãy nhìn mọi việc một cách đơn giản hơn.'),(268,4,73,0,31,'a'),(269,4,83,0,31,NULL),(270,4,106,0,31,NULL),(271,4,72,0,32,'c'),(272,4,73,0,32,'a'),(273,4,83,0,32,NULL),(274,4,106,0,32,NULL),(302,4,72,0,37,'new product'),(303,4,73,0,37,'new'),(304,4,83,0,37,NULL),(305,4,106,0,37,NULL),(306,4,72,0,38,'new product'),(307,4,73,0,38,'new'),(308,4,83,0,38,NULL),(309,4,101,0,38,NULL),(310,4,106,0,38,NULL),(311,4,72,0,39,'new product'),(312,4,73,0,39,'new'),(313,4,83,0,39,NULL),(314,4,101,0,39,NULL),(315,4,106,0,39,NULL),(316,4,72,0,40,'new product'),(317,4,73,0,40,'new'),(318,4,83,0,40,NULL),(319,4,101,0,40,NULL),(320,4,106,0,40,NULL),(321,4,72,0,41,'new product'),(322,4,73,0,41,'new'),(323,4,83,0,41,NULL),(324,4,101,0,41,NULL),(325,4,106,0,41,NULL),(326,4,72,0,42,'new product'),(327,4,73,0,42,'new'),(328,4,83,0,42,NULL),(329,4,101,0,42,NULL),(330,4,106,0,42,NU