ng gây xôn xao trong đời sống văn học, bởi ở đó người ta tìm thấy sự dữ dội, khốc liệt của đời sống thôn dã qua cái nhìn của một cô gái. Bi kịch về nỗi mất mát, sự cô đơn được đẩy lên đến tận cùng, khiến người đọc có lúc cảm thấy nhói tim... NXB Trẻ trân trọng giới thiệu cùng bạn đọc.'),(812,4,73,0,61,'Tác giả	Nguyễn Ngọc Tư'),(813,4,83,0,61,NULL),(814,4,106,0,61,NULL),(815,4,72,0,62,'Gió Lẻ Và 9 Câu Chuyện Khác (Tái Bản 2017)\r\n\r\nTiếp theo Ngọn đèn không tắt, Giao Thừa, Cánh đồng bất tận, Gió lẻ và 9 câu chuyện khác vẫn là những câu chuyện về những thân phận con người với cái nhìn đau đáu xót xa dưới ngòi bút của cây viết trẻ Nguyễn Ngọc Tư.'),(816,4,73,0,62,'Tác giả	Nguyễn Ngọc Tư'),(817,4,83,0,62,NULL),(818,4,106,0,62,NULL),(819,4,72,0,63,'Happy Stories In Viet Nam\r\n\r\nHappy stories in Viet Nam: được Đỗ Hương viết chung với Mr Happy, được thể hiện dưới hình thức đẹp các tạp văn và nhiều hình ảnh minh hoạ. Đó là những chia sẻ, trải nghiệm những chuyện thiết thân trong cuộc sống hàng ngày, như chuyện yêu con một cách “hiện đại” của Mr Happy: \"Nếu yêu con, muốn thể hiện tình yêu đó thì chính các cha mẹ phải đầu tư cho mình. Mình phải hỏi thật nhiều, học kỹ năng nhiều, giỏi ngoại ngữ, phải có tư duy sáng tạo, phải có trí tuệ. Có như thế thì con cái mới được thụ hưởng những giá trị đó”. Hoặc hạnh phúc từ việc dám làm điều mình thích như Đỗ Hương \"Nếu muốn có những ký ức ấn tượng mạnh mẽ không thể phai mờ, thì đừng bao giờ ngại đi một mình, khi muốn đi đâu đó, bất kể khuya sớm, đêm ngày, mưa nắng, dù không thể rủ ai đi cùng. Gạt bỏ nỗi sợ tưởng tượng chưa xảy đến, bạn sẽ được trải nghiệm và biết mình xử trí thế nào trước cuộc đời rất thực tế, chứ không phải trên giảng đường hay trong sách vở. Đôi khi không phụ thuộc vào tiền ít hay nhiều nếu bạn là người sáng tạo. Chỉ cần bạn Dám làm điều mình thích đã là trải nghiệm quý giá và có bài học kinh nghiệm cho bản thân rồi.\"'),(820,4,73,0,63,'Tác giả	Mr.Happy - Đỗ Hương'),(821,4,83,0,63,NULL),(822,4,106,0,63,NULL),(823,4,72,0,64,'Nỗi Buồn Đàn Ông\r\n\r\nTập truyện gồm hai phần: những tiểu phẩm hài, và các tạp bút cũng mang yếu tố hài hước. Bằng cách tạo ra những tiếng cười khi vui nhộn, lúc thâm trầm, tác giả mạnh tay phê phán những thói hư tật xấu trong xã hội.'),(824,4,73,0,64,'Tác giả	Lê Văn Nghĩa'),(825,4,83,0,64,NULL),(826,4,106,0,64,NULL),(827,4,72,0,65,'Nợ Nhau Lời Tạm Biệt\r\n\r\nCăn hộ mình em ở,\r\ngiường lớn mỗi em nằm\r\nbốn mùa của một năm\r\nmỗi mình em thương nhớ...\r\n\r\nNhững mối tình không có kết thúc, những mối tình chẳng thể đặt tên, những mối tình không thể cho nhau một danh phận thực sự lúc nào cũng là những mối tình khiến cho con người ta day dứt và băn khoăn suốt cả một đời.\r\n\r\nNgười ta bảo, chuyện tình cảm là chuyện của hai người, chỉ cần hai người đồng lòng, sẽ không có gì là khó khăn cả. Nhưng người ta quên mất rằng, cuộc sống của mỗi người, đâu chỉ có mỗi chuyện tình cảm? Bên cạnh tình yêu, người ta còn rất nhiều những mối quan hệ, những mối bận tâm và những niềm riêng đôi lúc không thể nói thành lời. Những khó khăn đó, làm tình yêu chậm lại, làm tình cảm phôi phai, làm hai người hai lối, thương thì thương lắm, mà không thể chạm vào...\r\n\r\nCó lẽ vì vậy, mà yêu nhau không đến được với nhau, tình cảm sâu nặng nhưng chẳng đủ can đảm để cho nhau một danh phận, nắm tay nhau công khai giữa phố xá đông đúc. Rồi cuối cùng lẳng lặng ra đi chẳng để lại cho nhau điều gì.\r\n\r\nCâu tạm biệt cũng chẳng nói nổi thành lời...'),(828,4,73,0,65,'Tác giả	Liêu Hà Trinh'),(829,4,83,0,65,NULL),(830,4,106,0,65,NULL),(831,4,72,0,66,'Tạm Biệt, Em Ổn!\r\n\r\n\"Tôi đi qua tuổi trẻ với những vết thương lòng sâu đến mức tôi tưởng nó ko thể lành được..\r\n\r\nỞ cuốn tản văn này - tôi nhìn thấy mình của tuổi 20 - nhìn thấy mình từ quá khứ... Tôi muốn tặng nó cho tôi của bây giờ để biết mình đã vượt qua khó khăn như thế nào.\r\n\r\nTặng cho người đã dạy tôi bài học về sự phản bội\r\n\r\nTặng cho anh - người tốt - đã luôn nắm chặt tay em và giúp em tin vào những điều đẹp đẽ cuối cùng còn sót lại.\r\n\r\nTặng cho tất cả các cô gái quanh tôi - để các gái thấy - bản thân mình là thứ cần yêu hơn bất cứ zai nào hết, dù cuộc đời chưa bao giờ là màu hồng như trong sách và truyện nam nữ càng không bao giờ giống ngôn tình trong truyện.\r\n\r\nVà cuối cùng:Tặng cho Sài Gòn - thành phố lung linh ánh sáng đầy kỉ niệm của tôi.”\r\n\r\n(Tờ Pi)\r\n\r\nNghĩ cho cùng, mọi thứ phù du rồi cũng tan biến. Có nắm tay nhau đi hết con đường không mới là quan trọng. Có tuổi trẻ nào không đi qua những chông gai. Có tình yêu nào không trải qua những thử thách chênh vênh.\r\n\r\nCó những vết sẹo trong tim ta cứ ngỡ chẳng bao giờ lành. Nhưng, sẽ rất lâu ta mới nhận ra rằng chính những vết sẹo, những chông gai ấy đã làm nên ta vững vàng, bản lĩnh hôm nay.\r\n\r\nTạm biệt, em ổn! là những lát cắt đa chiều như thế. Viết về tình yêu, tình bạn, về lẽ sống của một người con gái đã từng yếu đuối, mỏng manh mà trở nên kiên cường, trở nên mạnh mẽ. Yêu thương chính mình, nuôi giữ ước mơ của mình chính là thứ cần yêu hơn hết bất cứ người đàn ông nào cả.'),(832,4,73,0,66,'Tác giả	Tờ Pi'),(833,4,83,0,66,NULL),(834,4,106,0,66,NULL),(861,4,72,0,70,'TOP 100 BEST SELLER -\r\n\r\nLẦN ĐẦU TIÊN CÓ BẢN QUYỀN CHÍNH THỨC TẠI VIỆT NAM\r\n\r\nHoàng tử bé được viết ở New York trong những ngày tác giả sống lưu vong và được xuất bản lần đầu tiên tại New York vào năm 1943, rồi đến năm 1946 mới được xuất bản tại Pháp. Không nghi ngờ gì, đây là tác phẩm nổi tiếng nhất, được đọc nhiều nhất và cũng được yêu mến nhất của Saint-Exupéry. Cuốn sách được bình chọn là tác phẩm hay nhất thế kỉ 20 ở Pháp, đồng thời cũng là cuốn sách Pháp được dịch và được đọc nhiều nhất trên thế giới. Với 250 ngôn ngữ dịch khác nhau kể cả phương ngữ cùng hơn 200 triệu bản in trên toàn thế giới, Hoàng tử bé được coi là một trong những tác phẩm bán chạy nhất của nhân loại. \r\n\r\nỞ Việt Nam, Hoàng tử bé được dịch và xuất bản khá sớm. Từ năm 1966 đã có  đồng thời hai bản dịch: Hoàng tử bé của Bùi Giáng do An Tiêm xuất bản và Cậu hoàng con của Trần Thiện Đạo do Khai Trí xuất bản. Từ đó đến nay đã có thêm nhiều bản dịch Hoàng tử bé mới của các dịch giả khác nhau. Bản dịch Hoàng tử bé lần này, xuất bản nhân dịp kỷ niệm 70 năm Hoàng tử bé ra đời, cũng là ấn bản đầu tiên được Gallimard chính thức chuyển nhượng bản quyền tại Việt Nam, hy vọng sẽ góp phần làm phong phú thêm việc dịch và tiếp nhận tác phẩm quan trọng này với các thế hệ độc giả.'),(862,4,73,0,70,'Tác giả: Antoine de Saint, Exupéry'),(863,4,83,0,70,NULL),(864,4,106,0,70,NULL),(881,4,72,0,71,'Tác giả quen thuộc của thiếu nhi, của tuổi ô mai. Những tập truyện của anh luôn dí dỏm, hài hước, đem lại nhiều cảm xúc, nhiều bài học nhẹ nhàng cho lứa tuổi học trò. Hãy đọc để cùng gặp những nhân vật rất dễ thương, hoặc phải vượt qua những hoàn cảnh khó khăn, hoặc sẵn lòng chia sẻ với bạn bè, người thân… Thậm chí cả những nhân vật tạm gọi là “phe xấu” với nhiều trò đùa nghịch… cũng mang dáng dấp hồn nhiên. Tất cả hướng về CHÂN – THIỆN – MỸ. Họ là năm người bạn với năm cá tính và hoàn cảnh khác nhau cùng chung trong một lớp học. Những trò nghịch ngợm trẻ con đôi khi gây ra mâu thuẫn, nhưng trên tất cả đó là những đứa trẻ ham học, giàu lòng nhân ái và biết quan tâm đến bạn bè. Cảm thông với hoàn cảnh của nhau, từng bạn nghĩ ra cách giúp đỡ bạn mình theo khả năng để tình bạn ấy lớn dần theo năm tháng.\r\n'),(882,4,73,0,71,'Tác giả: Nguyễn Nhật Ánh '),(883,4,83,0,71,NULL),(884,4,106,0,71,NULL),(885,4,72,0,72,'Cây Chuối Non Đi Giày Xanh (Bìa Cứng)\r\n\r\nTrích \"Cây Chuối Non Đi Giày Xanh\"\r\n\"Khác với mùa thu rón rén, bao giờ mùa hè cũng về với những bước chân rộn ràng. Cây phượng trước sân trường tôi và cây phượng trước sân chùa Giác Nguyên thi nhau nở đỏ thắm mấy hôm nay. Trên những ngọn cây cao hai bên bờ suối, tiếng ve đã bắt đầu râm ran. Và trên cánh đồng dẫn vô con suối xóm Trong, cỏ khô đi dưới cái nắng như thiêu, rủ nhau chuyển sang màu rơm rạ và phát ra tiếng kêu lạo xạo mỗi khi bánh xe của chú tiểu Khôi lăn qua.\r\n\r\n....\r\n\r\nKhi người ta lớn lên, niềm vui và nỗi buồn cũng lớn lên theo. Trong những giấc mơ của tôi, không có châu chấu chuồn chuồn như những ngày thơ bé. Đã có bão giông theo về trong những đêm gió luồn qua mái lá. Ờ, ngay cả giấc mơ cũng lớn lên đó thôi.\"\r\n'),(886,4,73,0,72,'Tác giả:  Nguyễn Nhật Ánh '),(887,4,83,0,72,NULL),(888,4,106,0,72,NULL),(889,4,72,0,73,'Mắt biếc - đôi mắt đẹp nhưng đượm buồn. Đôi mắt của sự ngây thơ, trong sáng nhưng lại xa xăm, ẩn chứa đâu đó những giọt lệ như sắp tuôn tràn. Đôi mắt của cả một cuộc đời đau khổ.\r\n\r\nSinh ra và lớn lên trong một ngôi làng cổ lỗ, nghèo nàn nơi phần cong của dải đất hình chữ S, Ngạn lớn lên cùng Hà Lan, cô bạn hàng xóm có một cái tên rất lạ và một đôi mắt đẹp lạ thường - đôi mắt biếc. Họ cùng học, cùng vui chơi, cùng lớn lên. Trong họ dần dần chớm nở một tình yêu lặng thầm dành cho nhau mà không dám tỏ bày. Để rồi khi lớn lên, khi cả hai cùng rời bỏ làng quê của mình để lên thành phố tiếp tục giấc mơ, ở nơi phồn hoa đô thị ấy, họ đã rẽ theo hai ngả đời. Một người vẫn đợi đó nhưng một người đã đi theo phương khác, hướng về nhau nhưng lại mãi không thuộc về cho nhau.\r\n\r\n\"Tôi không thể bắt Hà Lan phải giống tôi.\r\n\r\nTôi khác. Không ai bắt tôi phải hoài vọng kỷ niệm. Không ai bắt tôi phải nhớ da diết cái làng nhỏ xa xăm của mình mỗi khi chiều xuống. Không ai bắt tôi đêm nào cũng phải mơ thấy bóng trăng tuổi thơ treo lơ lửng trên đường làng và rơi từng giọt vàng xuống giàn hoa thiên lý. Những điều đó xảy đến một cách tự nhiên, cũng giống như hồi học lớp chín, một hôm nhìn vào mắt Hà Lan, lần đầu tiên tôi cảm thấy lòng mình dậy sóng. Mà chẳng hiểu vì sao.\"\r\n\r\nQua những đồi sim, cây thị, những giàn thiên lý, đắm mình trong dòng chảy của thời gian và tâm trạng của chính Ngạn, xuyên suốt tập truyện dài Mắt biếc là cả một nỗi buồn man mác kéo dài, một nỗi tiếc nhớ, một nỗi lòng đau đáu của chính Ngạn về những kỷ niệm một thời học trò thơ mộng nơi làng Đo Đo nhỏ nghèo nàn, nơi những kỷ niệm đẹp nay chỉ còn lại những hoài niệm xa xăm của một thời đã qua.\r\n\r\nCảnh vẫn còn đó nhưng mắt biếc của năm xưa nay đâu...\r\n'),(890,4,73,0,73,'Tác giả:  Nguyễn Nhật Ánh '),(891,4,83,0,73,NULL),(892,4,106,0,73,NULL),(903,4,72,0,75,'Đủ Xa Sẽ Cũ Đủ Lạ Sẽ Quên\r\n\r\nĐỦ XA SẼ CŨ, ĐỦ LẠ SẼ QUÊN\r\n\r\nĐAU ĐỦ RỒI, HẠNH PHÚC ĐƯỢC HAY CHƯA?\r\n\r\nCuốn sách dành tặng những cái buông tay không đành lòng.\r\n\r\nỞ bên bạn trong hành trình buông bỏ và yêu chính mình\r\n\r\n----\r\n\r\nQuên đi ai đó, thật ra không khó như chúng ta nghĩ. Chỉ là, đừng vì đôi khi vô tình không kìm được nỗi nhớ lại lơ ngơ nhắn tin cho họ. Đừng vì đôi khi chưa kịp bỏ đi thói quen cũ mà cứ liên tục lục lại hình ảnh của ngày xưa.\r\n\r\nRời xa ai đó, thật ra không dễ nhưng chúng ta rồi sẽ làm được thôi. Chỉ là, đôi khi phải chấp nhận cô đơn, chấp nhận một mình. Chấp nhận những đêm nhớ đến quặn lòng, những buổi sáng thức dậy đợi mãi một dòng tin nhắn như đã từng.\r\n\r\nĐã từng vấp ngã một lần, một lần rời xa, một lần đau, đừng cho chính mình cơ hội tổn thương thêm một lần nào nữa.\r\n\r\nPhải tâm niệm thế này\r\n\r\nNếu trong một mối quan hệ mà bạn đứng sau quá nhiều điều thì nên dừng lại, ngẫm lại và tự hiểu...\r\n\r\nNếu trong tình yêu bạn không phải là người duy nhất, bạn ở đó , đứng sau quá nhiều người, quá nhiều lựa chọn, quá nhiều ưu tiên thì hãy khẽ cười và tự rút lui...\r\n\r\nNếu trong một chuyện tình mà giải thích mãi người ta cũng không chịu hiểu thì nên chào tạm biệt và từ bỏ nhanh thôi...\r\n\r\nNếu duyên số chỉ đến chừng ấy thì cưỡng cầu cũng được ích gì? .\r\n\r\nVì cuộc đời không có từ “mãi mãi” nên nắm không được thì phải học buông tay!\r\n\r\nVà nếu đã buông tay, hãy học cách bước qua nỗi đau thật kiêu hãnh, thật mạnh mẽ để đừng khiến bản thân tổn thương nhiều hơn nữa.\r\n\r\nCó những chuyện đau, tốt nhất thay vì nhắc lại và chạm vào, hãy để nó im lặng rồi dần tan biến. Biết đâu một ngày, đứng giữa hiên thềm nắng gió, tôi, bạn, những người đã cũ, vẫn yên bình đứng đó nhưng đã chẳng còn yêu. Khi khoảng cách, giờ cũng đã quá nhiều.\r\n\r\nĐến một lúc nào đó, nhẹ nhàng bước ở hai thành phố khác nhau, chúng ta nhìn lên trời và thở hắt:\r\n\r\nHôm nay, đủ xa sẽ cũ,\r\n\r\nMai này, đủ lạ sẽ quên!...\r\n\r\nChậm thôi, rồi ta sẽ thôi đau, chuyện gì rồi cũng qua thôi\r\n\r\n“Đủ xa sẽ cũ, đủ lạ sẽ quên” dành cho bạn, những trái tim đã đi qua đổ vỡ.\r\n\r\nMong bạn hiểu rằng: Đã đến lúc phải hạnh phúc rồi!\r\n'),(904,4,73,0,75,'Tác giả: Khải vệ'),(905,4,83,0,75,NULL),(906,4,106,0,75,NULL);
